import PropTypes from 'prop-types';

const data = [
    {
        key: '1',
        name: 'John',
        address: 'New York',
    },
    {
        key: '2',
        name: 'Jim',
        address: 'London',
    },
];

const Column = props => {
    const { title, dataIndex, ...columnProps } = props;

    return (
        <>
            {data.map(user => (
                <tr>
                    <td className='px-6 py-4 whitespace-nowrap'>
                        <div className='flex items-center'>
                            <div className='text-sm font-medium text-gray-900'>{'user[dataIndex]'}</div>
                        </div>
                    </td>
                </tr>
            ))}
        </>
    );
};

Column.propTypes = {};

export default Column;
